package ionic

import (
	"encoding/json"
	"fmt"
	"net/http"
	"testing"

	. "github.com/franela/goblin"
	"github.com/gomicro/bogus"
	. "github.com/onsi/gomega"
)

func TestProducts(t *testing.T) {
	g := Goblin(t)
	RegisterFailHandler(func(m string, _ ...int) { g.Fail(m) })

	g.Describe("Products", func() {
		server := bogus.New()
		server.Start()
		h, p := server.HostPort()
		client, _ := New(fmt.Sprintf("http://%v:%v", h, p))

		g.It("should get a product", func() {
			server.AddPath("/v1/vulnerability/getProducts").
				SetMethods("GET").
				SetPayload([]byte(SampleValidProduct)).
				SetStatus(http.StatusOK)

			product, err := client.GetProducts("cpe:/a:ruby-lang:ruby:1.8.7", "someapikey")
			Expect(err).To(BeNil())
			Expect(product[0].ID).To(Equal(99182))
			Expect(product[0].Name).To(Equal("ruby"))
		})

		g.It("should get a raw product", func() {
			server.AddPath("/v1/vulnerability/getProducts").
				SetMethods("GET").
				SetPayload([]byte(SampleValidProduct)).
				SetStatus(http.StatusOK)

			raw, err := client.GetRawProducts("cpe:/a:ruby-lang:ruby:1.8.7", "fookey")
			Expect(err).To(BeNil())
			Expect(raw).To(Equal(json.RawMessage(SampleValidRawProduct)))
		})
		g.It("should search for a product", func() {
			server.AddPath("/v1/product/search").
				SetMethods("GET").
				SetPayload([]byte(sampleBunsenSearchResponse)).
				SetStatus(http.StatusOK)
			raw, err := client.GetProductSearch("django", "someapikey")
			Expect(err).To(BeNil())
			Expect(raw).To(Equal(json.RawMessage(sampleRawBunsenSearchResponse)))
		})
	})
}

